import React from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';

const PostList = (props) => {
    console.log(props);

    return (
        <Container>
            <Row> <ul>
                {props.posts.map((element, index) =>
                    <li key={index}>
                        {element.title}
                    </li>
                )}
            </ul>
                <Col>
                    <ul>
                        <li>

                        </li>
                    </ul>
                   </Col>
            </Row>
        </Container>

    )
}

export default PostList
